import { ltThanLength } from '../';
describe('ltThanLength', function () {
  it('[{}] should be > zero', function () {
    expect(ltThanLength(0, [{}])).toBeTruthy();
  });
  it('[] should not be > zero', function () {
    expect(ltThanLength(0, [])).toBeFalsy();
  });
  it('should support curry', function () {
    var lengthBiggerThanZero = ltThanLength(0);
    expect(lengthBiggerThanZero([{}])).toBeTruthy();
  });
});